-- Step 4: Create the get_user_theme_id() function
-- This function returns the theme_id assigned to the current user
-- Currently returns 18 (Star Wars) for theme_analyst role
-- Can be extended to support other themes in the future

CREATE OR REPLACE FUNCTION get_user_theme_id() 
RETURNS INTEGER AS $$
BEGIN
    -- Check if the current user is theme_analyst
    IF current_user = 'theme_analyst' THEN
        RETURN 18;  -- Star Wars theme
    END IF;

    -- For superusers and postgres user, allow access to all themes
    IF current_user IN ('postgres') OR pg_catalog.pg_has_role(current_user, 'pg_database_owner', 'MEMBER') THEN
        RETURN NULL;  -- NULL means no restriction
    END IF;

    -- Default: no access (return -1 which won't match any theme)
    RETURN -1;
END;
$$ LANGUAGE plpgsql STABLE SECURITY DEFINER;

-- Grant execute permission to theme_analyst
GRANT EXECUTE ON FUNCTION get_user_theme_id() TO theme_analyst;
"}

