RETURNS INTEGER AS $$
DECLARE
    current_user_name TEXT;
BEGIN
    -- Get the current user (session_user for the actual logged-in user)
    current_user_name := session_user;

    -- Check if the current user is theme_analyst
    IF current_user_name = 'theme_analyst' THEN
        RETURN 18;  -- Star Wars theme
    END IF;

    -- For superusers and postgres user, allow access to all themes (NULL = no restriction)
    IF current_user_name IN ('postgres') THEN
        RETURN NULL;
    END IF;

    -- Check if user is a superuser
    IF EXISTS (
        SELECT 1 FROM pg_roles 
        WHERE rolname = current_user_name 
        AND rolsuper = true
    ) THEN
        RETURN NULL;
    END IF;

    -- Default: no access (return -1 which won't match any theme)
    RETURN -1;
END;
$$ LANGUAGE plpgsql STABLE SECURITY DEFINER;

-- Grant execute permission
GRANT EXECUTE ON FUNCTION get_user_theme_id() TO PUBLIC;
